  <div class="contents">
    <p  class="x_62b81fb4"><span  ><strong  >نظام منفتح وحرّ</strong></span></p><p  class="x_62b81fb4"><strong  ></strong>سهّلت السياسات الاقتصادية المنفتحة، والرقابة الحكومية المرنة، وتنظيمات القطاع الخاصّ من عملية الاستثمار الأجنبي المباشر وعملت على تمكين التنافس على المستوى العالمي.</p>
